        <Fragment>
            <header className={classes.header}>
                 <h1>ReactMeals</h1>
                 <button>Cart</button>
            </header>
            <div className={classes['main-image']}>
                <img src={mealsImage} />
            </div>
        </Fragment>
    )
}

    export default Header;
